  - name: $$FormScript
    type: text
    data: |
      '++LotusScript Development Environment:2:5:(Options):0:66
      Option Declare
      '++LotusScript Development Environment:2:5:(Forward):0:1
      Declare Sub Querysave(Source As Notesuidocument, Continue As Variant)
      
      '++LotusScript Development Environment:2:5:(Declarations):0:2
      
      '++LotusScript Development Environment:2:2:Querysave:1:12
      Sub Querysave(Source As Notesuidocument, Continue As Variant)
      	Dim s As New NotesSession
      	Dim thisDoc As NotesDocument	
      	
      	Dim errtxt As String, efldname As String
      	
      	On Error Goto errHandler
      	Set thisDoc = Source.Document	
      	
           ' Write the UNID to F_ProjectID field.
      	Call thisDoc.replaceItemValue("F_ProjectID", thisDoc.UniversalID)  
      	
           ''''''''''''''''''''''''
           ' F_AppName Validation
           ''''''''''''''''''''''''     
      	
      	Dim projectName As String, StrChar As String
      	Dim projectNameLen As Integer  
      	Dim i As Integer    
      	
      	projectName = thisDoc.GetItemValue("F_AppName")(0)
      	projectNameLen = Len(projectName)     
      	
           ' Make sure project name isn't blank.
      	If (projectName = "") Then
      		efldname = "F_AppName"
      		errtxt = "The Name field must contain a value."
      		Error 1000, errtxt
      	End If
      	
           ' Make sure project name contains valid characters.     
      	For i = 1 To projectNameLen
      		
      		strChar = Mid$(projectName, i, 1)          
      		
                ' Include list 
      		If Not (strChar)  Like "[0-9A-Za-z_]" Then
      			efldname = "F_AppName"
      			errtxt = "The project name contains invalid character(s)."
      			Error 1000, errtxt          
      		Elseif(i = 1) And Isnumeric(strChar) Then
      			efldname = "F_AppName"
      			errtxt = "The project name is not valid. The first character of an identifier name must be a nondigit.."
      			Error 1000, errtxt     
      		End If
      		
      	Next i
      	
      getOut:
      	Exit Sub
      	
      errHandler:
      	Continue = False
      	Select Case Err
      	Case 1000
      		errtxt = Error$
      		If efldname <> "" Then Call source.GotoField(efldname)
      		efldname = ""
      	Case 1001 To 1050
      		errtxt = Error$ & " (in QUERYSAVE - ln: " & Erl & ")"
      	Case Else
      		errtxt = Error$ & " (in QUERYSAVE - er: " & Err & "; ln: " & Erl & ")"
      	End Select
      	
      	Msgbox errtxt,, "VSID Error"
      	Resume getOut		
      End Sub
      '++LotusScript Development Environment:2:2:BindEvents:1:129
      Private Sub BindEvents ( Byval ObjectName_ As String )
      	Static Source As NOTESUIDOCUMENT
      	Set Source = Bind(Objectname_)
      	On Event QUERYSAVE From Source Call QUERYSAVE
      End Sub
